Starring  Tori Black, Lexi Belle, Danny Mountain, Rocco Reed, Johnny Castle, Jasmine Delaton 

The depth of their love runs so deep that it continues to penetrate her soul long after he is gone. Emily's husband Brian passed away two years ago, but she has not been able to move on with her life. She is still haunted by his ghost -- ...    Full Descriptionshe sees him watching her, she hears him calling her, and she feels him inside of her. Emily is tormented by An Eternal Love.

But when a surprise visit is made by handsome British Musician, Tom, and Emily's friends, Sasha and Bobby, passion is sparked and Emily's life heats up. Will Brian's ghost reappear and hinder Emily's chance with a new flame?

New Sensations: Romance presents An Eternal Love, a story of romance and lust at its most spirited. 

